import React from 'react';
import { AppBar, Toolbar, Button, IconButton, Typography } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from 'react-router-dom';

const MyAppBar = () => {
  const navigate = useNavigate();

  const navigateHome = () => {
    navigate("/home");
  };

  const navigateAbout = () => {
    navigate("/about");
  };

  const handleLogout = () => {
    navigate("/");
  };

  return (
    <AppBar 
      position="static" 
      sx={{
        backgroundColor: '#3f51b5',
        width: '100%', // Makes the navbar full width
        margin: 0,     // Ensures no gaps around it
        padding: '0 16px', // Optional padding for inner content
      }}
    >
      <Toolbar
        sx={{
          justifyContent: 'space-between', // Space out the items
        }}
      >
        <IconButton
          size="large"
          edge="start"
          color="inherit"
          aria-label="menu"
          sx={{ mr: 2 }}
        >
          <MenuIcon />
        </IconButton>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          e-Sahayatha
        </Typography>
        <Button color="inherit" onClick={navigateHome}>Home</Button>
        <Button color="inherit" onClick={navigateAbout}>About</Button>
        <Button color="inherit" onClick={handleLogout}>Logout</Button>
      </Toolbar>
    </AppBar>
  );
};

export default MyAppBar;
